var gr = new GlideRecord('x_759169_lva_vehicle_tracker');

gr.initialize();
gr.setValue('request_number', current.number);
gr.setValue('assigned_to', current.variables.requested_for);
gr.setValue('vehicle', current.variables.select_the_vehicle_that_you_need);
gr.setValue('date_requested', current.variables.date_needed);
gr.setValue('expected_return_date', current.variables.date_to_return_the_vehicle);
gr.setValue('location', current.variables.office_location);
gr.setValue('delivery_information', current.variables.delivery_information);
gr.setValue('additional_comments', current.variables.additional_comments);
gr.setValue('vehicle_status', 'Pending Release');
gr.setValue('tracker_status', 'Open');
gr.insert();

